            "סילבוס": "פוסטולטים של מכאניקת הקוונטים. מערכת שני מצבים: ספין, ספירת בלוך, תהודה מגנטית גרעינית ( NMR ), שליטה קוהרנטית על מצב ספין. מטרולוגיה קוונטית: MRI, שעונים אטומים. חישוב קוונטי: קיוביט, שערים ואלגוריתמים קוונטים. אינפורמציה קוונטית: שזירות ומטריצת הצפיפות. תקשורת והצפנה קוונטית. מימושים למחשוב קוונטים: NMR, CAVITY QED וצמתי ג'וספסון. אינטרקציה בין אור וחומר: צימוד חלש וחזק, מודל JAYNCE - CUMMING . סימולטורים קוונטים וחומרים קוונטים.% מטרת הקורס היא ללמד את היסודות הנדרשים להבנה ופיתוח טכנולוגיות קוונטיות, בדגש על אפליקציות מבוססות וטכנולוגיות מתפתחות. נלמד ייצוג מידע קוונטי דרך ספין וספירת בלוך, יחד עם שיטות לשליטה קוהרנטית. הסטודנטים ירכשו את העקרונות מאחורי MRI, NMR, ושעונים אטומיים, תוך סקירת תהליך המחקר שהוביל לטכנולוגיות אלו. על בסיס אבני בניין שיירכשו, יילמדו אינפורמציה, תקשורת, ומחשוב קוונטי. הסטודנטים יישמו אלגוריתם המתאים למחשב קוונטי ( IBM-Q ). בנוסף,יילמדו בהרחבה אתגרי ואופני המימוש העיקריים ברמת החומרה והשליטה במערכת תוך שימוש בעקרונות הלקוחים מאינטראקציות אור-חומר. לשם כך, יילמדו אתגרי המימוש מרמת החומרה דרך אופן קידוד האינפורמציה ועד אלגוריתמיקה קוונטית בסיסית. בהתאם להספק בכיתה הסטודנטים יקבלו טעימה מעקרונות של אינטראקציית אור-חומר וחומרים קוונטיים. בסיום הקורס, הסטודנטים ירכשו את הבסיס הפיסיקלי להשתלבות בקבוצת מחקר העוסקת בטכנולוגיות קוונטיות ויבינו את אופן התכנון של התקנים קוונטים.",
