            "הערות": "שחיה מתחילים - מיועדת לסטודנטים\nחסרי ידע לחלוטין בשחיה!\n====================\nשחיה שלב ב' - מיועדת לשיפור השחיה\nשל שחיינים מתחילים.\n====================\nשחיה לבינוניים מיועדת לסטודנטים\nהיודעים לשחות היטב ב-2 סגנונות\nשחיה לפחות.\n====================\nשחיה מתקדמים - מיועדת לסטודנטים -\nהשוחים טוב מאד בשלושה סגנונות.\n====================\nעל בעלי שיער ארוך לשחות עם כובע ים.\nנוכחות חובה בכל השיעורים.\nקב'27-פעילות גופנית במים בליווי\nמוזיקה ותיפוף.\n====================\nקב'32+31-רישום אצל המאמן באישור\nסמכות דתית בלבד.\n====================\nקב'34+17-15-בכל יום א' הראשון בחודש\nיתקיים השעור בחדר הכושר בבנין הספורט\n====================\nקב' 36+35 מתקיימות במרכז ימי חיפה -\nהחוף השקט.\nקב' 37-מתקיימת בקהונה סרף קלאב -\nרחוב דוד אלעזר 10,מלון מרידיאן,חיפה.",
